const toString = Object.prototype.toString

export function isDate(val: any): val is Date {
    return toString.call(val) == '[object Date]';
}

export function isObject(val: any): val is Object {
    return val != null && typeof val === 'object';
}

export function isPlainObject(val: any): val is Object {
    return toString.call(val) === '[object Object]';
}

export function extend<T, U>(to: T, from: U): T & U {
    for (const key in from) {
        (to as T & U)[key] = from[key] as any
    }
    return to as T & U;
}

import { isDate, isPlainObject } from './util';

function encode(val: string): string {
    return encodeURIComponent(val)
        .replace('/%40/g', '@')
        .replace('/%3A/ig', ':')
        .replace('/%24/g', '$')
        .replace('/%2C/ig', ',')
        .replace('/%20/g', '+')
        .replace('/%5B/g', '[')
        .replace('/%5D/g', ']')
}

export function buildURL(url: string, params?: any): string {
    if (!params) return url;
    const parts: string[] = [];
    Object.keys(params).forEach((key) => {
        const val = params[key];
        if (val === null || typeof val === 'undefined') return;
        let values = [];
        if (Array.isArray(val)) {
            values = val;
            key += '[]';
        } else {
            values = [val];
        }
        values.forEach((val) => {
            if (isDate(val)) {
                val = val.toISOString();
            } else if (isPlainObject(val)) {
                val = JSON.stringify(val);
            }
            parts.push(`${encode(key)}=${encode(val)}`);
        })
    })
    let serializedParams = parts.join('&');
    if (serializedParams) {
        const markIndex = url.indexOf('#');
        if (markIndex !== -1) {
            url = url.slice(0, markIndex);
        }
        url += (url.indexOf('?') === -1 ? '?' : '&') + serializedParams;
    }
    return url;
}

import { isPlainObject } from './util';

export function transfromRequest(data: any): any {
    if (isPlainObject(data)) return JSON.stringify(data);
    return data;
}

export function transfromResponse(data: any): any {
    if (typeof data === 'string') {
        try {
            data = JSON.parse(data);
        } catch (e) {
            // do nothing
        }
    }
    return data;
}

import { isPlainObject } from './util';

function normalizeHeaderName(headers: any, normalizedName: string): void {
    if (!headers) return;
    Object.keys(headers).forEach((name) => {
        if (name !== normalizedName && name.toUpperCase() === normalizedName.toUpperCase()) {
            headers[normalizedName] = headers[name];
            delete headers[name];
        }
    });
}

export function processHeaders(headers: any, data: any): any {
    normalizeHeaderName(headers, 'Content-Type');
    if (isPlainObject(data)) {
        if (headers && !headers['Content-Type']) {
            headers['Content-Type'] = 'application/json;charset=utf-8';
        }
    }
    return headers;
}

export function parseHeaders(headers: string): any {
    let parsed = Object.create(null);
    if (!headers) return parsed;
    headers.split('\r\n').forEach(line => {
        let [key, val] = line.split(':');
        key = key.trim().toLowerCase();
        if (!key) return;
        if (val) val = val.trim();
        parsed[key] = val;
    })
    return parsed;
}

import { AxiosResponse, AxiosRequestConfig } from './../types';

export class AxiosError extends Error {
    isAxiosError: boolean
    config: AxiosRequestConfig
    code?: string | null
    request?: any
    response?: AxiosResponse

    constructor(
        message: string,
        config: AxiosRequestConfig,
        code?: string | null,
        request?: any,
        response?: AxiosResponse
    ) {
        super(message);
        this.config = config;
        this.code = code;
        this.request = request;
        this.response = response;
        this.isAxiosError = true;
        Object.setPrototypeOf(this, AxiosError.prototype);
    }
}

export function createError(
    message: string,
    config: AxiosRequestConfig,
    code?: string | null,
    request?: any,
    response?: AxiosResponse
): AxiosError {
    const error = new AxiosError(message, config, code, request, response);
    return error;
}

import { AxiosRequestConfig, AxiosPromise, AxiosResponse } from '../types';
import { parseHeaders } from '../helpers/headers';
import { createError } from '../helpers/error';

export default function xhr(config: AxiosRequestConfig): AxiosPromise {
    return new Promise((resolve: any, reject: any) => {
        const { data = null, url, method = 'get', headers, responseType, timeout } = config;
        const request = new XMLHttpRequest();
        // 响应值类型
        if (responseType) {
            request.responseType = responseType;
        }
        if (timeout) {
            request.timeout = timeout;
        }
        request.open(method.toLocaleUpperCase(), url!, true);
        // 监听状态变化
        request.onreadystatechange = function handleLoad() {
            if (request.readyState != 4) return;
            const responseHeaders = parseHeaders(request.getAllResponseHeaders());
            const responseData = responseType !== 'text' ? request.response : request.responseText;
            const response: AxiosResponse = {
                data: responseData,
                status: request.status,
                statusText: request.statusText,
                headers: responseHeaders,
                config,
                request
            }
            if (request.status === 0) return;
            handleResponse(response);
        }
        // 错误处理
        request.onerror = function handleError() {
            reject(createError("Network Error", config, null, request));
        }
        // 超时处理
        request.ontimeout = function handleTimeout() {
            reject(createError(`Timeout of ${timeout} ms exceeded`, config, 'ECONNABORTED', request));
        }

        Object.keys(headers).forEach((name) => {
            if (data === null && name.toLowerCase() == 'content-type') {
                delete headers[name];
            } else {
                request.setRequestHeader(name, headers[name]);
            }
        })
        request.send(data);

        function handleResponse(response: AxiosResponse): void {
            if (response.status >= 200 && response.status < 300) {
                resolve(response);
            } else {
                reject(createError(`Request failed with status code ${response.status}`,
                    config, null, request, response));
            }
        }
    })

}

import { AxiosRequestConfig, AxiosPromise, AxiosResponse } from '../types';
import { buildURL } from '../helpers/url';
import { transfromRequest, transfromResponse } from '../helpers/data';
import { processHeaders } from '../helpers/headers'
import xhr from './xhr';


export default function dispatchRequest(config: AxiosRequestConfig): AxiosPromise {
    processConfig(config);
    return xhr(config).then((res) => {
        return transformResponseData(res);
    });
}

function processConfig(config: AxiosRequestConfig): void {
    config.url = transformURL(config);
    config.headers = transformRequestHeaders(config);
    config.data = transformRequestData(config);
}

function transformURL(config: AxiosRequestConfig): string {
    const { url, params } = config;
    return buildURL(url!, params);
}

function transformRequestData(config: AxiosRequestConfig): any {
    return transfromRequest(config.data);
}

function transformRequestHeaders(config: AxiosRequestConfig): any {
    const { data, headers = {} } = config;
    return processHeaders(headers, data);
}

function transformResponseData(res: AxiosResponse): AxiosResponse {
    res.data = transfromResponse(res.data);
    return res;
}

import { RejectedFn, ResolvedFn } from "../types";

interface Interceptor<T> {
    resolved: ResolvedFn<T>;
    rejected?: RejectedFn<T>;
}

export class InterceptorManagers<T> {
    private interceptor: Array<Interceptor<T> | null>;
    constructor() {
        this.interceptor = [];
    }

    use(resolved: ResolvedFn<T>, rejected?: RejectedFn<T>): number {
        this.interceptor.push({
            resolved,
            rejected,
        })
        return this.interceptor.length - 1;
    }

    eject(id: number): void {
        if (this.interceptor[id]) {
            this.interceptor[id] = null;
        }
    }

    forEach(fn: (interceptor: Interceptor<T>) => void): void {
        this.interceptor.forEach(interceptor => {
            if (interceptor !== null) {
                fn(interceptor);
            }
        })
    }
}

import { AxiosPromise, AxiosRequestConfig, AxiosResponse, Method, RejectedFn, ResolvedFn } from "../types";
import dispatchRequest from "./disptchRequest";
import { InterceptorManagers } from "./Interceptor";


interface Interceptor {
    // 请求拦截器
    request: InterceptorManagers<AxiosRequestConfig>;
    // 响应拦截器
    response: InterceptorManagers<AxiosResponse>;
}

interface PromiseChain<T> {
    resolved: ResolvedFn<T> | ((config: AxiosRequestConfig) => AxiosPromise),
    rejected?: RejectedFn<T>
}

export default class Axios {
    // 拦截器
    interceptors: Interceptor

    constructor() {
        this.interceptors = {
            request: new InterceptorManagers<AxiosRequestConfig>(),
            response: new InterceptorManagers<AxiosResponse>(),
        }
    }

    request(url: any, config?: any): AxiosPromise {
        if (typeof url === 'string') {
            if (!config) config = {};
            config.url = url;
        } else {
            config = url;
        }
        // 调用链
        const chain: PromiseChain<any>[] = [{
            resolved: dispatchRequest,
            rejected: undefined
        }]
        this.interceptors.request.forEach(interceptor => {
            chain.unshift(interceptor);
        })
        this.interceptors.response.forEach(interceptor => {
            chain.push(interceptor);
        })
        let promise = Promise.resolve(config);
        while (chain.length) {
            const { resolved, rejected } = chain.shift()!;
            promise = promise.then(resolved, rejected);
        }
        return promise;
    }

    get(url: string, config?: AxiosRequestConfig): AxiosPromise {
        return this._requestMethodWithoutData('get', url, config);
    }

    delete(url: string, config?: AxiosRequestConfig): AxiosPromise {
        return this._requestMethodWithoutData('delete', url, config);
    }

    post(url: string, data?: any, config?: AxiosRequestConfig): AxiosPromise {
        return this._requestMethodWithData('post', url, data, config);
    }

    put(url: string, data?: any, config?: AxiosRequestConfig): AxiosPromise {
        return this._requestMethodWithData('put', url, data, config);
    }

    patch(url: string, data?: any, config?: AxiosRequestConfig): AxiosPromise {
        return this._requestMethodWithData('patch', url, data, config);
    }

    _requestMethodWithoutData(method: Method, url: string, config?: AxiosRequestConfig): AxiosPromise {
        return this.request(Object.assign(config || {}, {
            url,
            method,
        }))
    }

    _requestMethodWithData(method: Method, url: string, data?: any, config?: AxiosRequestConfig): AxiosPromise {
        return this.request(Object.assign(config || {}, {
            url,
            method,
            data,
        }))
    }
}

import Axios from "./core/Axios";
import { extend } from "./helpers/util";
import { AxiosInstance } from "./types";


function createInstance() {
    const context = new Axios();
    // 这样instance就指向了request方法，且上下文指向context，所以可以直接以 instance(option) 方式调用 
    // Axios.prototype.request 内对第一个参数的数据类型判断，使我们能够以 instance(url, option) 方式调用
    const instance = Axios.prototype.request.bind(context);
    extend(instance, context);
    return instance as AxiosInstance;
}

const axios = createInstance();


